mapper.select:
select 

from transaction_application
where AppSheetSerialNo = #{appsheetserialno,jdbcType=VARCHAR}
  and DistributorCode = #{distributorcode,jdbcType=VARCHAR}
  and ReferenceNumber = #{referencenumber,jdbcType=INTEGER}
  and TACode = #{tacode,jdbcType=VARCHAR}

mapper.delete:
delete from transaction_application
where AppSheetSerialNo = #{appsheetserialno,jdbcType=VARCHAR}
  and DistributorCode = #{distributorcode,jdbcType=VARCHAR}
  and ReferenceNumber = #{referencenumber,jdbcType=INTEGER}
  and TACode = #{tacode,jdbcType=VARCHAR}
